export default function cleanSet(set, startString) {
  let string = [];
  let returnValue;
  if(!startString){
   return '';
  }
  for(let val of set) {
    if(val.startsWith(startString)){
      string.push(val.slice(startString.length));
      returnValue = string.join('-');
    }
  }
  return returnValue
}

